import React, { Component } from 'react';
import { bindActionCreators } from 'redux';
import { connect } from 'react-redux';
import { consumeApi, consumeApiPut } from '../actions'

class ConsumeApi extends Component {
    constructor(props){
        super(props)


    }
    createlist(){
        return <li>hola</li>
    }
    render() {
        return (
            <div>
                <ul>
                    {this.createlist}
                </ul>
            </div>
        );
    }
}

function mapStateToProps({ consumeApiReducer }) {
    return { consumeApiReducer };
}
function mapDispatchToProps(dispatch) {
    return bindActionCreators({ consumeApi, consumeApiPut }, dispatch);
}

export default connect(mapStateToProps, mapDispatchToProps)(ConsumeApi);
